import React from "react";
import ".//navBar.css";

export default function NavBar() {
  return (
    <nav className="custome-navbar">
      <ul className="navbar-nav ">
        <li className="nav-item">
          <a class="nav-link active" aria-current="page" href="#">
            الكتب
          </a>
        </li>
      </ul>
    </nav>
  );
}
